import gallery from "../../assets/gallery";
import "./index.css";

const Gallery = () => {
  return (
    <div className="MainGallery">
      <h1>Gallery</h1>
      {gallery.map((gallery) => (
        <img src={gallery.url} alt="image" />
      ))}
    </div>
  );
};

export default Gallery;
